        private void edtAuswertungUserID_UserModifiedFld(object sender, KiSS4.Gui.UserModifiedFldEventArgs e)
        {
            // Letzte Bearbeitung
            // 08.09.2007 : sozheo : Alles neu
            // ------------------------------------------------------------------------------

            string SearchString = edtAuswertungUserID.Text.Replace("*", "%").Replace("?", "_").Replace(" ", "%");

            if (DBUtil.IsEmpty(SearchString))
            {
                if (e.ButtonClicked)
                    SearchString = "%";
                else
                {
                    qryFaZielvereinbarung["AuswertungUserID"] = DBNull.Value;
                    qryFaZielvereinbarung["AuswertungUser"] = DBNull.Value;
                    return;
                }
            }

            KissLookupDialog dlg = new KissLookupDialog();
            e.Cancel = !dlg.SearchData(@"
              SELECT ID$ = U.UserID,
                [Kürzel] = U.LogonName,
                [Mitarbeiter/in] = U.LastName + isNull(', ' + U.FirstName,''),
                [Org.Einheit]    = XOU.ItemName
              FROM XUser U
                left join XOrgUnit_User OUU ON OUU.UserID = U.UserID AND OUU.OrgUnitMemberCode = 2
                left join XOrgUnit XOU ON XOU.OrgUnitID = OUU.OrgUnitID
              WHERE U.LogonName LIKE '%' + {0} + '%'
              ORDER BY U.LogonName",
              SearchString,
              e.ButtonClicked,null,null,null);

            if (!e.Cancel)
            {
                qryFaZielvereinbarung["AuswertungUserID"] = dlg[0];
                qryFaZielvereinbarung["AuswertungUser"] = dlg[1];
            }
        }

        private void qryFaZielvereinbarung_AfterPost(object sender, System.EventArgs e)
        {
            if (!DBUtil.IsEmpty(this.qryFaZielvereinbarung["DatumAuswertungDurchgefuehrt"]))
            {
                //Eintrag ins Fallverlaufsprotokoll
                DBUtil.ExecSQL(@"
                    INSERT FaJournal (FaFallID, FaLeistungID, BaPersonID, UserID, Text, OrgUnitID)
                            VALUES ({0},{1},{2},{3},{4}, {5})",
                                   faFallID, faLeistungID,
                                   qryFaZielvereinbarung["BaPersonID"], Session.User.UserID, "Zielvereinbarung ausgewertet", Session.User["OrgUnitID"]);
            }

            this.SetEditMode();
        }

